import { Link } from "react-router-dom";

export default function Game1(props) {

  const [mario, bandicoot, pikachu, formatter, handleClick, cods, g1, zoom, seconds] = props;

  return (
    <div className="main-wrap1">
      {/* nav bar */}
      <div className="sec1">
        <div className="zoom characters">
          <img src={mario} alt="mario" title="Mario" />
          <img src={bandicoot} alt="crash bandicoot" title="Crash Bandicoot" />
          <img src={pikachu} alt="naruto" title="Pikachu" />
        </div>
        {/* timer and home button */}
        <div className="zoom counter">{formatter(seconds)}
        <Link to="/">
          <div  className="home">
        <button>Home</button>
        </div>
        </Link>
        </div>

        <div className="zoom zooms">
          <button className="hov" title="Zoom in & out" onClick={handleClick}>
            Zoom
          </button>
        </div>
      </div>

      {/* search area */}
      <div className={zoom ? "zoom-in img" : "sec2"}>
        <img onClick={cods} src={g1} alt="game 1" />
      </div>
    </div>
  );
}
